import React from 'react';

function Counter(){
    return(
        <React.Fragment>
        <h1>Counter for using functional class and useState</h1>

        <button onClick={()=> alert('counter update')}>Update Counter</button>
        </React.Fragment>
    )
}

export default Counter;
